import SwiftUI
import WidgetKit
import AppIntents
@_private(sourceFile: "Event.swift") import DoriKit

struct EventWidgets: Widget {
    let kind: String = "com.memz233.Greatdori.Widgets.Event"
    var body: some WidgetConfiguration {
        AppIntentConfiguration(kind: kind, intent: EventWidgetIntent.self, provider: Provider()) { entry in
            EventWidgetsEntryView(entry: entry)
                .containerBackground(.background, for: .widget)
        }
        .supportedFamilies([.systemSmall, .systemMedium])
        .contentMarginsDisabled()
        .configurationDisplayName("Widget.event")
        .description("Widget.event.description")
    }
}

private struct Provider: AppIntentTimelineProvider {
    func placeholder(in context: Context) -> EventEntry {
        .init(locale: .jp)
    }
    
    func snapshot(for configuration: EventWidgetIntent, in context: Context) async -> EventEntry {
        if context.isPreview {
            return .init(
                event: .init(
                    id: 264,
                    eventType: .medley,
                    eventName: .init(
                        _jp: "白き想い、約束を咲かせて",
                        en: "White Feelings, Our Promise in Bloom",
                        tw: "純白心意，綻放約定之花",
                        cn: "纯洁的思念、绽放的约定",
                        kr: nil
                    ),
                    assetBundleName: "",
                    bannerAssetBundleName: "",
                    startAt: .init(forEveryLocale: nil),
                    endAt: .init(forEveryLocale: nil),
                    attributes: [],
                    characters: [],
                    eventAttributeAndCharacterBonus: nil,
                    eventCharacterParameterBonus: nil,
                    members: [],
                    limitBreaks: [],
                    musicIDs: nil,
                    rewardCards: []
                ),
                eventImageData: _previewEventImageData.forLocale(
                    _previewEventImageData.availableLocale(
                        prefer: configuration.locale.doriLocale
                    ) ?? .jp
                ),
                countdownOverride: "Widget.event.countdown.preview-override",
                locale: .init(
                    rawValue: UserDefaults(suiteName: "group.memz233.Greatdori.Widgets")!
                        .string(forKey: "PreferredLocale") ?? "jp"
                ) ?? .jp
            )
        }
        
        return await entry(in: configuration.locale)
    }
    
    func timeline(for configuration: EventWidgetIntent, in context: Context) async -> Timeline<Entry> {
        let nextUpdateDate = Calendar.current
            .date(byAdding: .hour, value: 1, to: .now)!
            .componentsRewritten(minute: 0, second: 1)
        return .init(
            entries: [
                await entry(in: configuration.locale)
            ],
            policy: .after(nextUpdateDate)
        )
    }
    
    func entry(in locale: WidgetDoriLocale) async -> EventEntry {
        await entry(in: locale.doriLocale)
    }
    func entry(in locale: DoriLocale) async -> EventEntry {
        guard let events = await Event.localizedLatest() else {
            print("Failed to get latest events")
            exit(EXIT_SUCCESS)
        }
        let event = events.forLocale(locale)!
        guard let eventImage = try? Data(contentsOf: event.bannerImageURL) else {
            print("Failed to get event image")
            exit(EXIT_SUCCESS)
        }
        
        return .init(
            event: event,
            eventImageData: eventImage,
            locale: locale
        )
    }
}

private struct EventEntry: TimelineEntry {
    let date: Date = .now
    
    var event: PreviewEvent?
    var eventImageData: Data?
    var countdownOverride: LocalizedStringResource?
    var locale: DoriLocale
}

private struct EventWidgetsEntryView : View {
    var entry: Provider.Entry
    @Environment(\.widgetFamily) private var widgetFamily
    var body: some View {
        ZStack {
            if let event = entry.event {
                VStack {
                    HStack {
                        Spacer(minLength: 0)
                        Group {
                            if let _data = entry.eventImageData,
                               let image = PlatformImage(data: _data) {
                                Group {
                                    #if os(macOS)
                                    Image(nsImage: image)
                                        .resizable()
                                        .antialiased(true)
                                        .interpolation(.high)
                                    #else
                                    Image(uiImage: image)
                                        .resizable()
                                        .antialiased(true)
                                        .interpolation(.high)
                                    #endif
                                }
                                .aspectRatio(3.0, contentMode: .fit)
                            } else {
                                RoundedRectangle(cornerRadius: 10)
                                    .fill(.gray)
                                    .aspectRatio(3.0, contentMode: .fit)
                            }
                        }
                        .frame(maxWidth: 500)
                        Spacer(minLength: 0)
                    }
                    
                    Text(event.eventName.forLocale(entry.locale) ?? event.eventName.forPreferredLocale() ?? "")
                        .typesettingLanguage(.explicit((event.eventName.availableLocale(prefer: entry.locale) ?? .jp).nsLocale().language))
                        .font(widgetFamily != .systemSmall ? .title3 : .callout)
                        .bold()
                        .multilineTextAlignment(.center)
                    Group {
                        if let override = entry.countdownOverride {
                            Text(override)
                        } else {
                            if let startDate = event.startAt.forLocale(entry.locale) ?? event.startAt.forPreferredLocale(),
                               let endDate = event.endAt.forLocale(entry.locale) ?? event.endAt.forPreferredLocale() {
                                if startDate > .now {
                                    Text("Widget.event.countdown.start-at.\(Text(startDate, style: .relative)).\("(\(entry.locale.rawValue.uppercased()))")")
                                } else if endDate > .now {
                                    Text("Widget.event.countdown.end-at.\(Text(endDate, style: .relative)).\("(\(entry.locale.rawValue.uppercased()))")")
                                } else {
                                    Text("Widget.event.countdown.ended.\("(\(entry.locale.rawValue.uppercased()))")")
                                }
                            } else {
                                Text("Widget.event.countdown.unstarted.\("(\(entry.locale.rawValue.uppercased()))")")
                            }
                        }
                    }
                    .multilineTextAlignment(.center)
                    .wrapIf(widgetFamily == .systemSmall) { content in
                        content
                            .font(.caption)
                    }
                }
            } else {
                VStack {
                    RoundedRectangle(cornerRadius: 10)
                        .fill(Color.gray.opacity(0.15))
                        .aspectRatio(3.0, contentMode: .fit)
                    Text(verbatim: "Lorem ipsum dolor sit amet consectetur")
                        .bold()
                        .font(.title3)
                        .foregroundStyle(.gray)
                        .redacted(reason: .placeholder)
                    Text(verbatim: "Lorem ipsum dolor")
                        .foregroundStyle(.gray)
                        .redacted(reason: .placeholder)
                }
            }
        }
        .padding()
    }
}

private let _previewEventImageData = LocalizedData<Data>(
    _jp: .init(base64Encoded: ""),
    en: .init(base64Encoded: ""),
    tw: .init(base64Encoded: ""),
    cn: .init(base64Encoded: ""),
    kr: nil
)
